import React, { useState } from 'react';

import './OrderDetails.css';

const OrderDetails = () => {
  const [formData, setFormData] = useState({
    pizza: 0,
    burgers: 0,
    mojitos: 0,
  });

  const handleFormChange = (newFormData) => {
    setFormData(newFormData);
  };

  return (
    <div>
      <OrderDetails formData={formData} onChange={handleFormChange} />
      <div>
        <center>
          <table>
            <thead>
              <tr>
                <th>First Name</th>
                <th>Last Name</th>
                <th>E-mail</th>
                <th>Phone No</th>
                <th>New Column</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td>{/* Insert first name here */}</td>
                <td>{/* Insert last name here */}</td>
                <td>{/* Insert email here */}</td>
                <td>{/* Insert phone number here */}</td>
                <td>{formData.pizza + formData.burgers + formData.mojitos}</td>
              </tr>
            </tbody>
          </table>
        </center>
      </div>
    </div>
  );
};

export default OrderDetails;
